import React from 'react';
import { useNavigate } from 'react-router-dom';
import './ClothesPage.css';

const clothes = [
  { id: 1, image: require('../assets/market.jpg'), name: 'Casual Shirt', price: 150 },
  { id: 2, image: require('../assets/market.jpg'), name: 'Leather Jacket', price: 500 },
  { id: 3, image: require('../assets/market.jpg'), name: 'Denim Jeans', price: 250 },
  { id: 4, image: require('../assets/market.jpg'), name: 'Summer Dress', price: 300 },
  { id: 5, image: require('../assets/'), name: 'Hoodie', price: 180 },
  { id: 6, image: require('../assets/sneakers.jpg'), name: 'Sneakers', price: 400 },
];

const ClothesPage = () => {
  const navigate = useNavigate();
  
  return (
    <div className="clothes-page">
      <h2>Available Clothes</h2>
      <div className="clothes-container">
        {clothes.map((item) => (
          <div className="clothes-item" key={item.id}>
            <img src={item.image} alt={item.name} />
            <h3>{item.name}</h3>
            <p className="price">GHâ‚µ {item.price}</p>
          </div>
        ))}
      </div>
      <button className="back-button" onClick={() => navigate(-1)}>Go Back</button>
    </div>
  );
};

export default ClothesPage;
